Actie / Misdaad
130 minuten

geregisseerd door Scott Waugh
met Aaron Paul, Dominic Cooper en Michael Keaton

Tobey Marshall (Aaron Paul), een jonge automonteur die er ingeluisd is door een rijke zakenman, is nog maar net uit de gevangenis wanneer hij mee gaat doen aan een cross-country race. Dit met een wraakplan in zijn gedachten. Waneer zijn ex-partner echter lucht krijgt van de race, schakelt deze direct de politie in.


